D1 VI, D2 I/13–14, A I/12–13 (10–14), C 14 (13–15) branched rays, P 18–19 (17–20), V I/ 5 + 5/I. Fin bases or lengths given in Table II. D1-spines not elongate, only fifth may slightly project. Narrow interdorsal space without membrane. D2 origin anterior of A origin. Rear tips of D2 and A reaching C origin, especially in males during breeding season. C rounded, rarely truncate. P, when pressed against the body, reaching back to below D2 3 rather in females and small specimens, in males to below D2 1 or D2 2. Three uppermost P-rays free from membrane. Pelvic disc with distinct emargination and reduced anterior membrane, which is not more than a skin fold in most specimens (
Figure 2
). Longest tips usually reach or exceed anus, latter rather in males than in females.
